INSERT INTO `dbt_sms_email_template` VALUES (15, 'email', 'token_listing_submit', 'Token Listing Submitted', 'Token Listing Submitted', '<h3>Token Listing</h3><img src=\'%logo_path%\' class=\"rounded\" alt=\"Token Logo\" style=\"max-width:100px\"><div style=\"display: flex; margin-bottom: 15px\"><div style=\"margin-right: 100px\"><span style=\"font-weight: bolder\">Token Name</span><br /><span>%token_name%</span></div><div><span style=\"font-weight: bolder\">Token Symbol</span><br /><span>%token_symbol%</span></div></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Token ID (TRC10 tokens) / Token Contract (TRC20 tokens) / Token Address (SOLANA)</span><br /><span>%token_id%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Network(s) (where the token is issued)</span><br /><span>%network%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">URL of Token on Tronscan, Solscan etc.</span><br /><span>%token_url%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Website (homepage) of Token project</span><br /><span>%token_project_website%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Short description of the Token project</span><br /><span>%token_project_des%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Is the Token already traded on other exchange?</span><br /><span>%is_traded_other%</span><br /><span>%token_exchange%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Will someone associated with your Token project act as a Market Maker for your Token on the ZeroFees Exchange?</span><br /><span>%someone_associated%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Founders / Stakeholders / Market Makers etc.</span><br /><span>%token_founders%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Are / are not willing to keep a market price floor?</span><br /><span>%is_price_floor%</span><br /><span>%floor_percent% percent</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Total Volume of the Token</span><br /><span>%total_volume%</span></div><div style=\"display: flex; margin-bottom: 15px\"><div style=\"margin-right: 100px\"><span style=\"font-weight: bolder\">Total Volume of the Token</span><br /><span>%total_volume%</span></div><div><span style=\"font-weight: bolder\">Circulation Volume</span><br /><span>%circulation_volume%</span></div></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">What percentage of Total Volume is reserved for Founders, Developers, Advisors, Team Members?</span><br /><span>%percetage_total_volume%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Proposed initial price for the token</span><br /><span>%initial_price_token%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Listing fees checked</span><br /><ul>%checked_fee_rows%</ul></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">XX Messenger Address</span><br /><span>%xx_messenger%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Applicant\'s Full Name</span><br /><span>%applicant_name%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Applicant\'s e-mail address</span><br /><span>%applicant_email%</span></div>', '<h3>Token Listing</h3><img src=\'%logo_path%\' class=\"rounded\" alt=\"Token Logo\" style=\"max-width:100px\"><div style=\"display: flex; margin-bottom: 15px\"><div style=\"margin-right: 100px\"><span style=\"font-weight: bolder\">Token Name</span><br /><span>%token_name%</span></div><div><span style=\"font-weight: bolder\">Token Symbol</span><br /><span>%token_symbol%</span></div></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Token ID (TRC10 tokens) / Token Contract (TRC20 tokens) / Token Address (SOLANA)</span><br /><span>%token_id%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Network(s) (where the token is issued)</span><br /><span>%network%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">URL of Token on Tronscan, Solscan etc.</span><br /><span>%token_url%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Website (homepage) of Token project</span><br /><span>%token_project_website%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Short description of the Token project</span><br /><span>%token_project_des%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Is the Token already traded on other exchange?</span><br /><span>%is_traded_other%</span><br /><span>%token_exchange%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Will someone associated with your Token project act as a Market Maker for your Token on the ZeroFees Exchange?</span><br /><span>%someone_associated%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Founders / Stakeholders / Market Makers etc.</span><br /><span>%token_founders%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Are / are not willing to keep a market price floor?</span><br /><span>%is_price_floor%</span><br /><span>%floor_percent% percent</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Total Volume of the Token</span><br /><span>%total_volume%</span></div><div style=\"display: flex; margin-bottom: 15px\"><div style=\"margin-right: 100px\"><span style=\"font-weight: bolder\">Total Volume of the Token</span><br /><span>%total_volume%</span></div><div><span style=\"font-weight: bolder\">Circulation Volume</span><br /><span>%circulation_volume%</span></div></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">What percentage of Total Volume is reserved for Founders, Developers, Advisors, Team Members?</span><br /><span>%percetage_total_volume%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Proposed initial price for the token</span><br /><span>%initial_price_token%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Listing fees checked</span><br /><ul>%checked_fee_rows%</ul></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">XX Messenger Address</span><br /><span>%xx_messenger%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Applicant\'s Full Name</span><br /><span>%applicant_name%</span></div><div style=\"margin-bottom: 15px\"><span style=\"font-weight: bolder\">Applicant\'s e-mail address</span><br /><span>%applicant_email%</span></div>');
