INSERT INTO `web_article` VALUES (10, NULL, 'Token Listing', '', '', '', '<p><span style=\"font-size:14px\"><strong>Zero trading fees</strong> (for trading pairs on USDE market) apply for the <strong>first 4 months</strong> of trading after listing the token.</span></p>\r\n\r\n<p><span style=\"font-size:14px\">Trading on other markets (USDC, USDT, etc) is with half the fees compared to other exchanges, i.e. 0.05%</span></p>\r\n', '', '<p><span style=\"font-size:small\">Listing of one token + one trading pair on USDE market: 99 USDE or 120 USDC/USDT</span></p>\r\n\r\n<p><span style=\"font-size:small\">Listing of one token + one trading pair on USDC market: 150 USDE or 180 USDC/USDT</span></p>\r\n\r\n<p>Listing of one token + one trading pair on USDT market: &nbsp; 150 USDE or 180 USDC/USDT</p>\r\n\r\n<p>Preference - placement of the Trading Pair in the Top 30 for 2 months: &nbsp; 300 USDE or 350 USDC/USDT</p>\r\n\r\n<p>Preference - placement of the Trading Pair in the Top 10 for 2 months: &nbsp; 999 USDE or 1200 USDC/USDT</p>\r\n\r\n<p>Creating a new market: &nbsp; 500 USDE or 600 USDC/USDT</p>\r\n\r\n<p>Extension of the Zero trading fees mode (on USDE market) for another 4 months: &nbsp; 999 USDE or 1200 USDC/USDT</p>\r\n', '', '', 32, 1, 1, '2022-09-01 07:12:50', 'admin@zerofees.excha', 0, 0);
